import React from 'react';
import './App.css';
import Particles from "react-particles-js";

function App() {
  return (
    <div className="App">
      <Particles
          params={{
            "particles": {
                "number": {
                    "value": 50
                },
                "size": {
                    "value": 3
                }
            },
            "interactivity": {
                "events": {
                    "onhover": {
                        "enable": true,
                        "mode": "repulse"
                    }
                }
            }
        }} />
      <h1>Maris-Angelique</h1>
      <h3>Full Stack Web Developer</h3>
    </div>
  );
}

export default App;
